import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import { validateClient } from '../utils/validation';

const AddClientForm: React.FC = () => {
    const history = useHistory();
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [nationalIdNumber, setNationalIdNumber] = useState('');
    const [postalCode, setPostalCode] = useState('');
    const [dateOfBirth, setDateOfBirth] = useState('');
    const [streetAddress, setStreetAddress] = useState('');
    const [city, setCity] = useState('');
    const [country, setCountry] = useState('');
    const [customerType, setCustomerType] = useState('Individual');
    const [loyaltyNumber, setLoyaltyNumber] = useState('');
    const [isActive, setIsActive] = useState(true);
    const [error, setError] = useState('');

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();

        // Validate the form data (mapping to validation function fields)
        const clientData = {
            firstName,
            lastName,
            email,
            phoneNumber,
            idNumber: nationalIdNumber, // Map to validation function
            postalCode,
            dateOfBirth,
            city
        };

        const validation = validateClient(clientData);

        if (!validation.isValid) {
            setError(validation.error);
            return;
        }

        setError('');

        // Create client object matching your API schema
        const newClient = {
            firstName,
            lastName,
            email,
            phoneNumber,
            nationalIdNumber,
            postalCode,
            dateOfBirth,
            streetAddress,
            city,
            country,
            customerType,
            loyaltyNumber,
            isActive
        };

        try {
            const response = await fetch('http://localhost:5001/client', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(newClient),
            });

            if (response.ok) {
                // Navigate back to client list
                history.push('/');
            } else {
                setError('Failed to create client');
            }
        } catch (error) {
            setError('Error creating client');
        }
    };

    const clearForm = () => {
        setFirstName('');
        setLastName('');
        setEmail('');
        setPhoneNumber('');
        setNationalIdNumber('');
        setPostalCode('');
        setDateOfBirth('');
        setStreetAddress('');
        setCity('');
        setCountry('');
        setCustomerType('Individual');
        setLoyaltyNumber('');
        setIsActive(true);
    };

    return (
        <form onSubmit={handleSubmit}>
            <h2>Add New Client</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <div>
                <label>First Name:</label>
                <input type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
            </div>
            <div>
                <label>Last Name:</label>
                <input type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} required />
            </div>
            <div>
                <label>Email:</label>
                <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
            </div>
            <div>
                <label>Phone Number (optional):</label>
                <input 
                    type="tel" 
                    value={phoneNumber} 
                    onChange={(e) => setPhoneNumber(e.target.value)} 
                    placeholder="+27XXXXXXXXX or 0XXXXXXXXX"
                />
            </div>
            <div>
                <label>ID Number:</label>
                <input 
                    type="text" 
                    value={nationalIdNumber} 
                    onChange={(e) => setNationalIdNumber(e.target.value)} 
                    required 
                    maxLength={13}
                    placeholder="13-digit South African ID"
                />
            </div>
            <div>
                <label>Street Address:</label>
                <input 
                    type="text" 
                    value={streetAddress} 
                    onChange={(e) => setStreetAddress(e.target.value)} 
                />
            </div>
            <div>
                <label>City:</label>
                <input type="text" value={city} onChange={(e) => setCity(e.target.value)} required />
            </div>
            <div>
                <label>Postal Code:</label>
                <input 
                    type="text" 
                    value={postalCode} 
                    onChange={(e) => setPostalCode(e.target.value)} 
                    required 
                    minLength={4}
                    maxLength={10}
                />
            </div>
            <div>
                <label>Country:</label>
                <input 
                    type="text" 
                    value={country} 
                    onChange={(e) => setCountry(e.target.value)} 
                />
            </div>
            <div>
                <label>Date of Birth:</label>
                <input 
                    type="date" 
                    value={dateOfBirth} 
                    onChange={(e) => setDateOfBirth(e.target.value)} 
                    required 
                />
            </div>
            <div>
                <label>Customer Type:</label>
                <select 
                    value={customerType} 
                    onChange={(e) => setCustomerType(e.target.value)} 
                    required
                >
                    <option value="Individual">Individual</option>
                    <option value="Business">Business</option>
                </select>
            </div>
            <div>
                <label>Loyalty Number:</label>
                <input 
                    type="text" 
                    value={loyaltyNumber} 
                    onChange={(e) => setLoyaltyNumber(e.target.value)} 
                />
            </div>
            <div>
                <label>
                    <input 
                        type="checkbox" 
                        checked={isActive} 
                        onChange={(e) => setIsActive(e.target.checked)} 
                    />
                    Active
                </label>
            </div>
            <button type="submit">Add Client</button>
            <button type="button" onClick={() => history.push('/')}>Cancel</button>
        </form>
    );
};

export default AddClientForm;
